function showInfo(organId) {
  const infoBox = document.getElementById('infoBox');
  const organ = organDetails[organId];

  if (!organ) return;


  let html = `
    <h3>${organ.title}</h3>
    <p>${organ.description}</p>
  `;


  if (organ.svg) {
    html += `<div class="organ-svg">${organ.svg}</div>`;
  }


  if (organ.image) {
    html += `<img src="${organ.image}" alt="${organ.title}" class="organ-image" />`;
  }

  infoBox.innerHTML = html;
  infoBox.scrollIntoView({ behavior: 'smooth' });
}

function toggleOrgan(organId, checkbox) {

  const organGroups = {
    trachea: ['trachea'],
    mouth: ['mouth'],
    lungs: ['lungs']
  };

  const organs = organGroups[organId] || [organId];

  organs.forEach(id => {
    const el = document.getElementById(id);
    if (el) el.style.display = checkbox.checked ? 'inline' : 'none';
  });
}
function resetSVG() {
  const wrapper = document.getElementById('svgWrapper');

  if (wrapper.classList.contains('shrunk')) {
    wrapper.classList.remove('shrunk');
  } else {
    wrapper.classList.add('shrunk');
  }
}

function showVideo() {
  const container = document.getElementById('videoContainer');

  if (!container.innerHTML) {
    container.innerHTML = `
      <iframe width="100%" height="400" 
        src="https://www.youtube.com/embed/7FhzSSQxM54" 
        title="How Digestion Works"
        frameborder="0"
        allowfullscreen>
      </iframe>
    `;
  }

  container.style.display = 'block';
  container.scrollIntoView({ behavior: 'smooth' });
}
